import { Component } from 'react';

class CreateDataset extends Component {
    constructor(props) {
        super(props)
        this.state = {
            httpMethod: 'DELETE',
        };

        this.handleClose = this.handleClose.bind(this)
        this.handelSubmit = this.handelSubmit.bind(this)
    }

    handelSubmit(e) {
        e.preventDefault();
        console.log(this.state.datasetConfigUserInput)
        this.props.handleSendRequest(this.props.datasetConfigJSON, this.state.httpMethod)
    }


    handelClose(e) {
        e.preventDefault();
        console.log(this.state.datasetConfigUserInput)
    }

    render() {
        return (
            <div>
                <form>
                    <h2>Do you want to Delete {this.props.datasetConfigJSON.name}?</h2>
                    <button onClick={this.handelSubmit}>Yes</button>
                    <button onClick={this.handelClose}>No</button>
                </form>
            </div>
        )
    }
}


export default DeleteDataset
